import logo from './logo.svg';
import styles from './App.module.scss';

function App() {
  return (
    <div className={styles['App']}>
      <header className={styles['App-header']}>
        <div>
          Edit <code>src/App.tsx</code> and save to reload.
        </div>
      </header>
    </div>
  );
}

export default App;
